// src/components/KPIs.js
import React, { useEffect, useState } from 'react';
import { Row, Col, Card } from 'react-bootstrap';

const KPIs = () => {
  const [ventas, setVentas] = useState([]);
  const [kpis, setKpis] = useState({
    totalVentas: 0,
    totalIngresos: 0,
    ticketPromedio: 0,
    clienteTop: '',
    productoTop: '',
    anioMasVentas: '',
  });

  useEffect(() => {
    fetch('http://localhost:8000/api/ventas/')
      .then(res => res.json())
      .then(data => {
        setVentas(data);

        if (data.length === 0) return;

        const totalVentas = data.length;
        const totalIngresos = data.reduce((acc, venta) => acc + parseFloat(venta.total), 0);
        const ticketPromedio = totalIngresos / totalVentas;

        const clienteContador = {};
        const productoContador = {};
        const anioContador = {};

        data.forEach(v => {
          const cliente = v.cliente.nombre;
          const producto = v.producto.nombre;
          const anio = new Date(v.tiempo.fecha).getFullYear();

          clienteContador[cliente] = (clienteContador[cliente] || 0) + 1;
          productoContador[producto] = (productoContador[producto] || 0) + 1;
          anioContador[anio] = (anioContador[anio] || 0) + 1;
        });

        const clienteTop = Object.entries(clienteContador).sort((a, b) => b[1] - a[1])[0][0];
        const productoTop = Object.entries(productoContador).sort((a, b) => b[1] - a[1])[0][0];
        const anioMasVentas = Object.entries(anioContador).sort((a, b) => b[1] - a[1])[0][0];

        setKpis({
          totalVentas,
          totalIngresos,
          ticketPromedio,
          clienteTop,
          productoTop,
          anioMasVentas,
        });
      });
  }, []);

  return (
    <div className="mt-4 mb-4">
      <Row className="g-3">
        <Col md={4}><Card body className="text-center"><strong>Total de Ventas</strong><div>{kpis.totalVentas}</div></Card></Col>
        <Col md={4}><Card body className="text-center"><strong>Total Ingresos</strong><div>€ {kpis.totalIngresos.toLocaleString('es-ES')}</div></Card></Col>
        <Col md={4}><Card body className="text-center"><strong>Ticket Promedio</strong><div>€ {kpis.ticketPromedio.toLocaleString('es-ES', { minimumFractionDigits: 2 })}</div></Card></Col>
        <Col md={4}><Card body className="text-center"><strong>Producto más vendido</strong><div>{kpis.productoTop}</div></Card></Col>
        <Col md={4}><Card body className="text-center"><strong>Cliente más frecuente</strong><div>{kpis.clienteTop}</div></Card></Col>
        <Col md={4}><Card body className="text-center"><strong>Año con más ventas</strong><div>{kpis.anioMasVentas}</div></Card></Col>
      </Row>
    </div>
  );
};

export default KPIs;
